import styled from "styled-components";

export const SignUpContainer = styled.div`
  display: flex;
  flex-direction: column;
  width: 400px;
  border: solid black 1px;

  span {
    font-size: 20px;
    font-weight: normal;
    opacity: 0.86;
    margin: 1px 0px;
  }
`;

export const SignUpTitle = styled.h2`
  font-size: 30px;
  font-weight: bold;
  border: solid red 1px;
  margin: 2px 0px 25px;
`;
